    Omit<
      import('./packages/qwik/').QwikIntrinsicElements['img'],
      'src' | 'width' | 'height' | 'srcSet'
    >
  >;
  export default Cmp;
  export const width: number;
  export const height: number;
  export const srcSet: string;
}

import { beforeAll } from 'vitest';

// This has to run before qdev.ts loads. `beforeAll` is too late
globalThis.qTest = true;
globalThis.qRuntimeQrl = true;
globalThis.qDev = true;
globalThis.qInspector = false;

beforeAll(async () => {
  const { getTestPlatform } = await import('./packages/qwik/src/testing/platform');
  const { setPlatform } = await import('./packages/qwik/src/core/platform/platform');
  setPlatform(getTestPlatform() as any);
});

import { defineConfig } from 'vitest/config';
import tsconfigPaths from 'vite-tsconfig-paths';

export default defineConfig({
  plugins: [tsconfigPaths({ ignoreConfigErrors: true })],
  test: {
    include: [
      'packages/**/*.unit.?(c|m)[jt]s?(x)',
      // Rust build cache
      '!packages/qwik/**/target',
      '!packages/qwik/dist',
      '!packages/*/lib',
      '!starters',
      '!**/node_modules',
      '!dist-dev',
    ],
    setupFiles: ['./vitest-setup.ts'],
  },
});

import { defineWorkspace } from 'vitest/config';

// needed by the vscode vitest integration but it also speeds up vitest cli
export default defineWorkspace(['./vitest.config.mts']);
